import album from "../assets/folk.png";
import album2 from "../assets/rep.png";
import album3 from "./NIL.jpg";
import album4 from "./oned.png";

export const albums = [
  {
    id: 1,
    Title: "Evermore",
    songs: 12,
    img: album,
  },
  {
    id: 2,
    Title: "Reputation",
    songs: 13,
    img: album2,
  },
  {
    id: 3,
    Title: "Nobody is listening",
    songs: 9,
    img: album3,
  },
  {
    id: 4,
    Title: "Made in the A.M.",
    songs: 10,
    img: album4,
  },
  {
    id: 5,
    Title: "Midnights",
    songs: 14,
    img: album2,
  },
];
